import {useState, useEffect} from 'react';

ManageCategory = () =>{
    useEffect(() => {
        fetch('url').then(
            response =>{
                return response.json();
            }
        ).then(data =>{
            console.log(data);
        })
    }, []);

    return;
}

export default ManageCategory;
